import styled from "@emotion/styled";

export const OrderItemWrapper = styled('div')`
    position: relative;
    width: 100%;

    .wrapper_inner {
        position: relative;
        width: 100%;
        display: flex;
        flex-direction: column;

        .order_box {
            position: relative;
            width: 100%;
            display: flex;
            flex-direction: column;
            padding-bottom: 20px;
            margin-top: 20px;
            border-bottom: 1px dashed #7a7a7a;

            .top_box {
                position: relative;
                width: 100%;
                display: flex;
            }
        }
    }    
`;
